import React, { useState, useRef, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './VHealthSearch.css';
import ImageUploadModal from './components/ImageUploadModal';
import MultiAuthLogin from './components/shared/components/MultiAuthLogin';
import { healthSearchService } from './services/healthSearchService';
import { searchCache } from './services/searchCache';
import { foodAnalysisService } from './components/foodAnalysisService';

const VHealthSearch: React.FC = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [isListening, setIsListening] = useState(false);
  const [isUploadModalOpen, setIsUploadModalOpen] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [imageError, setImageError] = useState(false);
  const [loadingMessage, setLoadingMessage] = useState('Searching...');
  
  const navigate = useNavigate();
  const searchInputRef = useRef<HTMLInputElement>(null);
  const recognitionRef = useRef<any>(null);

  const handleUserChange = (user: any) => {
    console.log('User changed:', user);
  };

  const handleSignIn = (user: any) => {
    console.log('User signed in:', user);
  };

  const handleSignOut = () => {
    console.log('User signed out');
  };

  const handleSearch = async () => {
    if (!searchQuery.trim()) return;
    
    setIsLoading(true);
    setLoadingMessage('Initializing search...');
    
    try {
      // Step 1: Check cache first
      setLoadingMessage('Checking cache...');
      await new Promise(resolve => setTimeout(resolve, 200)); // Small delay for UX
      
      // Fix: Use the correct method name for searchCache
      const cachedResult = searchCache.getCachedResult(searchQuery.toLowerCase());
      
      if (cachedResult) {
        console.log('Found cached result for:', searchQuery);
        setLoadingMessage('Loading cached results...');
        await new Promise(resolve => setTimeout(resolve, 300));
        
        // Only navigate when we have the cached data ready
        navigate(`/results?q=${encodeURIComponent(searchQuery)}`);
        return;
      }

      // Step 2: Query the health search service (OpenAI/API)
      setLoadingMessage('Analyzing with AI...');
      console.log('Searching for:', searchQuery);
      
      try {
        // Fix: Use the correct method name - searchHealthInfo instead of searchHealth
        const searchResults = await healthSearchService.searchHealthInfo(searchQuery);
        console.log('Health search results:', searchResults);
        
        if (searchResults) {
          // Step 3: Cache the results
          setLoadingMessage('Processing results...');
          const cacheData = {
            query: searchQuery,
            results: searchResults,
            timestamp: Date.now(),
            dataSource: searchResults.dataSource || 'openai'
          };
          
          // Fix: Use the correct method name for caching
          searchCache.cacheResult(searchQuery.toLowerCase(), cacheData);
          
          // Step 4: Only navigate when we have complete results
          setLoadingMessage('Results ready!');
          await new Promise(resolve => setTimeout(resolve, 200));
          
          navigate(`/results?q=${encodeURIComponent(searchQuery)}`);
          return;
        }
      } catch (apiError) {
        console.error('Health search service failed:', apiError);
        setLoadingMessage('API unavailable, generating response...');
      }

      // Fallback: Generate mock response if API fails
      setLoadingMessage('Generating response...');
      await new Promise(resolve => setTimeout(resolve, 1000)); // Simulate processing
      
      const mockResult = {
        query: searchQuery,
        results: `I understand you're asking about "${searchQuery}". This is a health-related query that would benefit from professional medical advice. For the most accurate and personalized information, please consult with healthcare professionals.`,
        timestamp: Date.now(),
        dataSource: 'fallback' as const
      };
      
      // Cache the fallback result
      searchCache.cacheResult(searchQuery.toLowerCase(), mockResult);
      
      // Only navigate when fallback is ready
      setLoadingMessage('Response ready!');
      await new Promise(resolve => setTimeout(resolve, 200));
      navigate(`/results?q=${encodeURIComponent(searchQuery)}`);
      
    } catch (error) {
      console.error("Search error:", error);
      setLoadingMessage('Search failed. Please try again.');
      
      // Show error for 2 seconds then reset
      setTimeout(() => {
        setIsLoading(false);
        setLoadingMessage('Searching...');
      }, 2000);
    }
  };

  const handleAnalysisComplete = async (foodName: string): Promise<void> => {
    if (!foodName) {
      setIsUploadModalOpen(false);
      return;
    }

    setIsLoading(true);
    setLoadingMessage('Processing image analysis...');
    
    try {
      console.log("Image analysis completed, food detected:", foodName);
      setSearchQuery(foodName);
      
      // Step 1: Check if we already have nutrition data cached
      setLoadingMessage('Checking nutrition database...');
      const cachedNutrition = searchCache.getCachedResult(foodName.toLowerCase());
      
      if (cachedNutrition) {
        setLoadingMessage('Found nutrition data!');
        await new Promise(resolve => setTimeout(resolve, 300));
        navigate(`/results?q=${encodeURIComponent(foodName)}`);
        return;
      }

      // Step 2: Get detailed nutrition analysis
      setLoadingMessage('Analyzing nutrition content...');
      
      try {
        // Try to get nutrition data from your services
        const nutritionResults = await healthSearchService.searchHealthInfo(foodName);
        
        if (nutritionResults) {
          setLoadingMessage('Processing nutrition data...');
          
          const nutritionCache = {
            query: foodName,
            results: nutritionResults,
            timestamp: Date.now(),
            dataSource: nutritionResults.dataSource || 'nutrition-api',
            imageAnalysis: true // Flag to indicate this came from image analysis
          };
          
          searchCache.cacheResult(foodName.toLowerCase(), nutritionCache);
          
          setLoadingMessage('Nutrition analysis complete!');
          await new Promise(resolve => setTimeout(resolve, 300));
          navigate(`/results?q=${encodeURIComponent(foodName)}`);
          return;
        }
      } catch (nutritionError) {
        console.error('Nutrition analysis failed:', nutritionError);
        setLoadingMessage('Generating nutrition summary...');
      }

      // Fallback: Generate mock nutrition data
      setLoadingMessage('Creating nutrition profile...');
      await new Promise(resolve => setTimeout(resolve, 800));
      
      const mockNutritionResult = {
        query: foodName,
        results: `Nutrition analysis for ${foodName}: This food item has been identified from your image. For detailed nutritional information including calories, macronutrients, vitamins, and minerals, please consult nutritional databases or speak with a registered dietitian.`,
        timestamp: Date.now(),
        dataSource: 'image-analysis' as const,
        imageAnalysis: true
      };
      
      searchCache.cacheResult(foodName.toLowerCase(), mockNutritionResult);
      
      setLoadingMessage('Nutrition profile ready!');
      await new Promise(resolve => setTimeout(resolve, 200));
      navigate(`/results?q=${encodeURIComponent(foodName)}`);
      
    } catch (error) {
      console.error("Error processing analyzed food:", error);
      setLoadingMessage('Analysis failed. Please try again.');
      
      setTimeout(() => {
        setIsLoading(false);
        setLoadingMessage('Searching...');
      }, 2000);
    } finally {
      setIsUploadModalOpen(false);
    }
  };

  const LoadingOverlay = () => (
    <div className="search-loading-overlay">
      <div className="search-loading-content">
        <div className="search-spinner"></div>
        <p>{loadingMessage}</p>
        {/* Progress indicator */}
        <div className="loading-progress">
          <div className="progress-bar">
            <div className="progress-fill"></div>
          </div>
        </div>
        {/* Additional context based on loading state */}
        {loadingMessage.includes('AI') && (
          <small className="loading-detail">This may take a few moments...</small>
        )}
        {loadingMessage.includes('image') && (
          <small className="loading-detail">Processing your uploaded image...</small>
        )}
      </div>
    </div>
  );

  // Reset loading state on component unmount
  useEffect(() => {
    return () => {
      setIsLoading(false);
      setLoadingMessage('Searching...');
    };
  }, []);

  return (
    <div className="search-landing">
      {isLoading && <LoadingOverlay />}
      
      <MultiAuthLogin 
        position="top-right"
        className="main-login-button"
        onUserChange={handleUserChange}
        onSignIn={handleSignIn}
        onSignOut={handleSignOut}
      />

      <div className="search-container-centered">
        <div className="logo-container">
          {!imageError ? (
            <img 
              src="/assets/293a2ef6-826c-4ec9-9b26-c2abf3bb894f.png"
              alt="What is Healthy?"
              className="search-logo-image"
              onError={() => setImageError(true)}
              onLoad={() => setImageError(false)}
            />
          ) : (
            <h1 className="search-logo">
              What is Healthy?
            </h1>
          )}
        </div>
        
        <div className="search-input-container">
          <form onSubmit={(e) => { 
            e.preventDefault();
            handleSearch();
          }}>
            <input
              type="text"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              onKeyPress={(e) => e.key === 'Enter' && handleSearch()}
              placeholder="Ask anything about health..."
              className="search-input"
              autoFocus
              disabled={isLoading}
            />
          </form>

          <div className="search-icons">
            {searchQuery && !isLoading && (
              <button
                type="button"
                onClick={() => setSearchQuery('')}
                className="icon-button clear-button"
                aria-label="Clear all"
              >
                <svg viewBox="0 0 24 24" fill="currentColor">
                  <path d="M19 6.41L17.59 5 12 10.59 6.41 5 5 6.41 10.59 12 5 17.59 6.41 19 12 13.41 17.59 19 19 17.59 13.41 12z"/>
                </svg>
              </button>
            )}
            
            <button
              type="button"
              onClick={() => setIsUploadModalOpen(true)}
              className="icon-button"
              aria-label="Upload image"
              disabled={isLoading}
            >
              <svg viewBox="0 0 24 24" fill="currentColor">
                <path d="M9 2L7.17 4H4c-1.1 0-2 .9-2 2v12c0 1.1.9 2 2 2h16c1.1 0 2-.9 2-2V6c0-1.1-.9-2-2-2h-3.17L15 2H9zm3 15c-2.76 0-5-2.24-5-5s2.24-5 5-5 5 2.24 5 5-2.24 5-5 5z"/>
              </svg>
            </button>
            
            <button
              type="button"
              onClick={() => {
                if (isLoading) return;
                
                if (!('webkitSpeechRecognition' in window)) {
                  alert('Speech recognition not supported in this browser');
                  return;
                }

                if (!recognitionRef.current) {
                  const recognition = new (window as any).webkitSpeechRecognition();
                  recognition.continuous = false;
                  recognition.interimResults = false;
                  recognition.lang = 'en-US';

                  recognition.onstart = () => setIsListening(true);
                  recognition.onresult = (event: any) => {
                    const transcript = event.results[0][0].transcript;
                    setSearchQuery(transcript);
                    setIsListening(false);
                  };
                  recognition.onerror = () => setIsListening(false);
                  recognition.onend = () => setIsListening(false);

                  recognitionRef.current = recognition;
                }

                if (!isListening) {
                  recognitionRef.current.start();
                } else {
                  recognitionRef.current.stop();
                  setIsListening(false);
                }
              }}
              className={`icon-button ${isListening ? 'listening' : ''}`}
              aria-label={isListening ? 'Stop listening' : 'Start voice input'}
              disabled={isLoading}
            >
              <svg viewBox="0 0 24 24" fill="currentColor">
                <path d="M12 14c1.66 0 3-1.34 3-3V5c0-1.66-1.34-3-3-3S9 3.34 9 5v6c0 1.66 1.34 3 3 3z"/>
                <path d="M17 11c0 2.76-2.24 5-5 5s-5-2.24-5-5H5c0 3.53 2.61 6.43 6 6.92V21h2v-3.28c3.39-.49 6-3.3 6-6.72h-2z"/>
              </svg>
            </button>
          </div>
        </div>

        <div className="search-buttons">
          <button 
            onClick={(e) => {
              e.preventDefault();
              handleSearch();
            }}
            className="search-btn primary"
            disabled={!searchQuery.trim() || isLoading}
          >
            {isLoading ? loadingMessage : 'Analyze Nutrition'}
          </button>
          
          <button 
            onClick={() => {
              if (isLoading) return;
              const healthyFoods = ['apple', 'broccoli', 'salmon', 'quinoa', 'blueberries'];
              const randomFood = healthyFoods[Math.floor(Math.random() * healthyFoods.length)];
              setSearchQuery(randomFood);
            }}
            className="search-btn secondary"
            type="button"
            style={{ color: '#000000' }}
            disabled={isLoading}
          >
            I'm Feeling Healthy
          </button>
        </div>
      </div>
      
      <ImageUploadModal
        isOpen={isUploadModalOpen}
        onClose={() => setIsUploadModalOpen(false)}
        onAnalysisComplete={handleAnalysisComplete}
        title="Upload Image"
        subtitle="Upload Image for Analysis"
      />
    </div>
  );
};

export default VHealthSearch;
